<!-- color big part of Schaffhausen when hovering over small part-->
<script>
    $(document).ready(function(){
        $("#sh_small").hover(function(){
            $("#sh_small").prev().css("fill", "#825B77");
            $("#sh_small").css("fill", "#825B77");
        }, function(){
            $("#sh_small").prev().css("fill", "#757575");
            $("#sh_small").css("fill", "#757575");
        });
        $("#sh_big").hover(function(){
            $("#sh_big").next().css("fill", "#825B77");
            $("#sh_big").css("fill", "#825B77");
        }, function(){
            $("#sh_big").next().css("fill", "#757575");
            $("#sh_big").css("fill", "#757575");
        });
    });
</script>
